import { config } from "../config/Config";

export const prototype = {
  alert,
  modal
};

function alert(type, message) {
  if (type == config.alertType.warning) {
    alert(message);
  }
}

function modal(modalName, type) {
  window.$("#" + modalName).modal(type);
}
